import {Form, Card, Container, Row, Col,Button} from "react-bootstrap";
import React , {useState} from 'react';
import axios from 'axios';

let [name, setName]= useState('');
let [lastName, setLastName]= useState('');
let [ville, setVille]= useState('');
let [email, setEmail]= useState('');
let [password, setPassword]= useState('');
const handleChange = (event) => {
    setName(event.target.name);
    setLastName(event.target.prenom);
    setVille(event.target.ville);
    setEmail(event.target.email);
    setPassword(event.target.password);
  }

  
  handleSubmit = event => {
    event.preventDefault();
 
    const user = {
      name: this.state.name,
      lastName: this.state.lastName,
      ville: this.state.ville,
      email: this.state.email,
      password: this.state.prenom

    };
 
    axios.post(`http://127.0.0.1:5000/api/v1/user`, { user })
      .then(res => {
        console.log(res);
        console.log(res.data);
      })
  }

const Signup = () => {
    return ( 
    <div style={{"padding-top":"30px","padding-bottom":"20px"}}>
        <Card style={{"margin":"auto","margin-bottom":"20px","width":"35%","min-width":"400px","padding":"20px 50px 20px 50px "}}>
            <h3 className="text-center">Bienvenue à Discount Picker</h3><br></br>
            <Form onSubmit={this.handleSubmit}>
                <Container>
                <Form.Group controlId="formName" >
                        <Row>
                            <Col>
                                <Form.Label>Prénom</Form.Label>
                            </Col>
                            <Col>
                                <Form.Control name="name" required type="text" placeholder="prénom" minLength={3} maxLength={20} onChange={this.handleChange}/>
                            </Col>
                        </Row>
                    </Form.Group><br></br>
                    <Form.Group controlId="formLastname" >
                        <Row>
                            <Col>
                                <Form.Label>Nom</Form.Label>
                            </Col>
                            <Col>
                                <Form.Control name="lastName" required type="text" placeholder="nom" minLength={3} maxLength={20} onChange={this.handleChange}/>
                            </Col>
                        </Row>
                    </Form.Group><br></br>
                    <Form.Group controlId="formVille" >
                        <Row>
                            <Col>
                                <Form.Label>Ville</Form.Label>
                            </Col>
                            <Col>
                                <Form.Control name="ville" required type="text" placeholder="ville" minLength={3} maxLength={20} onChange={this.handleChange}/>
                            </Col>
                        </Row>
                    </Form.Group><br></br>
                    <Form.Group controlId="formEmail" >
                        <Row>
                            <Col>
                                <Form.Label>Email</Form.Label>
                            </Col>
                            <Col>
                                <Form.Control name="email" required type="email" placeholder="exemple@mail.com" onChange={this.handleChange}/>
                            </Col>
                        </Row>
                    </Form.Group><br></br>
                    <Form.Group controlId="formPassword" >
                        <Row>
                            <Col>
                                <Form.Label>Mot de passe</Form.Label>
                            </Col>
                            <Col>
                                <Form.Control name="password" required type="password" placeholder="*********" minLength={5} onChange={this.handleChange}/>
                            </Col>
                        </Row>
                    </Form.Group>
                </Container>
                <div className="text-center"><br></br>
                    <input type="checkbox" name="conditions" required/>
                    &nbsp;
                    <label>J'accepte <a href="conditions" style={{"text-decoration":"underline"}}>les conditions générales</a> d'utilisation.</label><br></br><br></br>
                    <input type="checkbox" name="newsletter"/>
                    &nbsp;
                    <label>J'aimerais reçevoir des notifications par email</label><br></br><br></br>
                    <Button type="submit" variant="info">Valider</Button><br></br><br></br>
                    <label>Vous avez un compte? <a href="login" style={{"text-decoration":"underline"}}>Se connecter</a></label><br></br>
                </div>
            </Form>
        </Card>
        </div>
     );
}
 
export default Signup;
